import React from 'react'
import './estilosComponentes/Limenus.css'
const Limenus = (datos) => {
    function tipo(){
        if(datos.tipoMenu===1){
            return "Entrada"
        }else if(datos.tipoMenu===2){
            return "Plato Fuerte"
        }else if(datos.tipoMenu===3){
            return "Postres"
        }else{
            return "Bebidas"
        }
    }
  return (
    <li key={datos.index} className='limenu'>
        <p>{datos.menusinfo.nombreMenu}</p>
        <p>Tipo: {tipo}</p>
        <p>Precio: {precio}</p>
    </li>
  )
}

export default Limenus
